INSERT INTO `sys_notice` VALUES ('1', '温馨提醒：2018-07-01 若依新版本发布啦', '2', '<p style=\"margin-bottom: 0px; font-size: 18px; color: rgb(51, 51, 51); padding-bottom: 25px; line-height: 36px; font-family: &quot;Microsoft Yahei&quot;; text-indent: 32px;\">新冠肺炎疫情是一场大考。赢得这次大考，既要立足当前，抓好当务之急，又<img src=\"http://localhost:8080/profile/upload/2020/03/03/918f9235de0dee13e2041c601403a0f5.jpg\" data-filename=\"/profile/upload/2020/03/03/918f9235de0dee13e2041c601403a0f5.jpg\" style=\"width: 300px;\">要放眼长远，谋划未来之策。3月2日，习近平继上月调研指导疫情防控之后，再次在北京考察。作为战“疫”总指挥的他，在此行中重点关注了什么，做了哪些重要部署，释放了哪些重要信息？</p><p style=\"margin-bottom: 0px; font-size: 18px; color: rgb(51, 51, 51); padding-bottom: 25px; line-height: 36px; font-family: &quot;Microsoft Yahei&quot;; text-indent: 32px;\">△联播视频：习近平在北京考察新冠肺炎防控科研攻关工作</p><p style=\"margin-bottom: 0px; font-size: 18px; color: rgb(51, 51, 51); padding-bottom: 25px; line-height: 36px; font-family: &quot;Microsoft Yahei&quot;; text-indent: 32px;\">硬仗之下，习近平看了哪些硬核产品？</p><p style=\"margin-bottom: 0px; font-size: 18px; color: rgb(51, 51, 51); padding-bottom: 25px; line-height: 36px; font-family: &quot;Microsoft Yahei&quot;; text-indent: 32px;\">2日下午，习近平首先来到军事医学研究院考察。疫情发生以来，军事医学研究院集中力量展开应急科研攻关，取得了阶段性成果。</p>', '0', 'admin', '2018-03-16 11:33:00', 'admin', '2020-03-03 11:23:04', '管理员');
INSERT INTO `sys_notice` VALUES ('2', '维护通知：2018-07-01 若依系统凌晨维护', '1', '<table style=\"background-color: rgb(255, 255, 255); color: rgb(103, 106, 108); width: 426px;\"><tbody><tr><td style=\"width: 149px; text-align: center; vertical-align: middle;\">单据号</td><td style=\"padding: 1px;\"><input class=\"form-control\" value=\"${djh}\" readonly=\"\" style=\"line-height: 1.42857; color: inherit; width: 275px; background-image: none; border-color: rgb(229, 230, 231); border-radius: 1px; box-shadow: none; cursor: pointer;\"></td></tr><tr><td style=\"width: 149px; text-align: center; vertical-align: middle;\">认购日期</td><td style=\"padding: 1px;\"><input class=\"form-control\" value=\"${rgrq}\" readonly=\"\" style=\"line-height: 1.42857; color: inherit; width: 275px; background-image: none; border-color: rgb(229, 230, 231); border-radius: 1px; box-shadow: none; cursor: pointer;\"></td></tr><tr><td style=\"width: 149px; text-align: center; vertical-align: middle;\"><br></td><td style=\"padding: 1px;\"></td></tr></tbody></table>', '0', 'admin', '2018-03-16 11:33:00', 'admin', '2020-03-18 11:07:27', '管理员');
