INSERT INTO `sys_oper_log` VALUES ('646', '通知公告', '2', 'com.ruoyi.web.controller.system.SysNoticeController.editSave()', 'POST', '1', 'admin', '研发部门', '/system/notice/edit', '127.0.0.1', '内网IP', '{\r\n  \"noticeId\" : [ \"1\" ],\r\n  \"noticeTitle\" : [ \"温馨提醒：2018-07-01 若依新版本发布啦\" ],\r\n  \"noticeType\" : [ \"2\" ],\r\n  \"noticeContent\" : [ \"<p style=\\\"margin-bottom: 0px; font-size: 18px; color: rgb(51, 51, 51); padding-bottom: 25px; line-height: 36px; font-family: &quot;Microsoft Yahei&quot;; text-indent: 32px;\\\">新冠肺炎疫情是一场大考。赢得这次大考，既要立足当前，抓好当务之急，又要放眼长远，谋划未来之策。3月2日，习近平继上月调研指导疫情防控之后，再次在北京考察。作为战“疫”总指挥的他，在此行中重点关注了什么，做了哪些重要部署，释放了哪些重要信息？</p><p style=\\\"margin-bottom: 0px; font-size: 18px; color: rgb(51, 51, 51); padding-bottom: 25px; line-height: 36px; font-family: &quot;Microsoft Yahei&quot;; text-indent: 32px;\\\">△联播视频：习近平在北京考察新冠肺炎防控科研攻关工作</p><p style=\\\"margin-bottom: 0px; font-size: 18px; color: rgb(51, 51, 51); padding-bottom: 25px; line-height: 36px; font-family: &quot;Microsoft Yahei&quot;; text-indent: 32px;\\\">硬仗之下，习近平看了哪些硬核产品？</p><p style=\\\"margin-bottom: 0px; font-size: 18px; color: rgb(51, 51, 51); padding-bottom: 25px; line-height: 36px; font-family: &quot;Microsoft Yahei&quot;; text-indent: 32px;\\\">2日下午，习近平首先来到军事医学研究院考察。疫情发生以来，军事医学研究院集中力量展开应急科研攻关，取得了阶段性成果。</p>\" ],\r\n  \"status\" : [ \"0\" ]\r\n}', '{\r\n  \"msg\" : \"操作成功\",\r\n  \"code\" : 0\r\n}', '0', null, '2020-03-03 11:21:12');
INSERT INTO `sys_oper_log` VALUES ('647', '通知公告', '2', 'com.ruoyi.web.controller.system.SysNoticeController.editSave()', 'POST', '1', 'admin', '研发部门', '/system/notice/edit', '127.0.0.1', '内网IP', '{\r\n  \"noticeId\" : [ \"1\" ],\r\n  \"noticeTitle\" : [ \"温馨提醒：2018-07-01 若依新版本发布啦\" ],\r\n  \"noticeType\" : [ \"2\" ],\r\n  \"noticeContent\" : [ \"<p style=\\\"margin-bottom: 0px; font-size: 18px; color: rgb(51, 51, 51); padding-bottom: 25px; line-height: 36px; font-family: &quot;Microsoft Yahei&quot;; text-indent: 32px;\\\">新冠肺炎疫情是一场大考。赢得这次大考，既要立足当前，抓好当务之急，又<img src=\\\"http://localhost:8080/profile/upload/2020/03/03/918f9235de0dee13e2041c601403a0f5.jpg\\\" data-filename=\\\"/profile/upload/2020/03/03/918f9235de0dee13e2041c601403a0f5.jpg\\\" style=\\\"width: 300px;\\\">要放眼长远，谋划未来之策。3月2日，习近平继上月调研指导疫情防控之后，再次在北京考察。作为战“疫”总指挥的他，在此行中重点关注了什么，做了哪些重要部署，释放了哪些重要信息？</p><p style=\\\"margin-bottom: 0px; font-size: 18px; color: rgb(51, 51, 51); padding-bottom: 25px; line-height: 36px; font-family: &quot;Microsoft Yahei&quot;; text-indent: 32px;\\\">△联播视频：习近平在北京考察新冠肺炎防控科研攻关工作</p><p style=\\\"margin-bottom: 0px; font-size: 18px; color: rgb(51, 51, 51); padding-bottom: 25px; line-height: 36px; font-family: &quot;Microsoft Yahei&quot;; text-indent: 32px;\\\">硬仗之下，习近平看了哪些硬核产品？</p><p style=\\\"margin-bottom: 0px; font-size: 18px; color: rgb(51, 51, 51); padding-bottom: 25px; line-height: 36px; font-family: &quot;Microsoft Yahei&quot;; text-indent: 32px;\\\">2日下午，习近平首先来到军事医学研究院考察。疫情发生以来，军事医学研究院集中力量展开应急科研攻关，取得了阶段性成果。</p>\" ],\r\n  \"status\" : [ \"0\" ]\r\n}', '{\r\n  \"msg\" : \"操作成功\",\r\n  \"code\" : 0\r\n}', '0', null, '2020-03-03 11:23:04');
