INSERT INTO `tb_print_template` VALUES ('74', '01', '0', '2020-03-18 16:32:22', '<p class=\"md-end-block md-p\" style=\"margin-top: 10px; margin-right: auto; margin-left: auto; padding: 0px; font-family: &quot;Helvetica Neue&quot;, Helvetica, Verdana, Arial, sans-serif; font-size: 14px; background-color: rgba(255, 255, 255, 0.6);\"><span class=\"md-plain\" style=\"margin: 0px; padding: 0px;\">如果表达式的值为true，则标签会渲染到页面，否则不进行渲染。</span></p><p class=\"md-end-block md-p\" style=\"margin-top: 10px; margin-right: auto; margin-left: auto; padding: 0px; font-family: &quot;Helvetica Neue&quot;, Helvetica, Verdana, Arial, sans-serif; font-size: 14px; background-color: rgba(255, 255, 255, 0.6);\"><span class=\"md-plain\" style=\"margin: 0px; padding: 0px;\">以下情况被认定为true：</span></p><ul class=\"ul-list\" data-mark=\"-\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 30px; padding: 0px; font-family: &quot;Helvetica Neue&quot;, Helvetica, Verdana, Arial, sans-serif; font-size: 14px; background-color: rgba(255, 255, 255, 0.6);\"><li class=\"md-list-item\" style=\"margin: 0px 0px 1em; padding: 0px; list-style: disc;\"><p class=\"md-end-block md-p\" style=\"margin-top: 10px; margin-right: auto; margin-left: auto; padding: 0px;\"><span class=\"md-plain\" style=\"margin: 0px; padding: 0px;\">表达式值为true</span></p></li><li class=\"md-list-item\" style=\"margin: 0px 0px 1em; padding: 0px; list-style: disc;\"><p class=\"md-end-block md-p\" style=\"margin-top: 10px; margin-right: auto; margin-left: auto; padding: 0px;\"><span class=\"md-plain\" style=\"margin: 0px; padding: 0px;\">表达式值为非0数值</span></p></li><li class=\"md-list-item\" style=\"margin: 0px 0px 1em; padding: 0px; list-style: disc;\"><p class=\"md-end-block md-p\" style=\"margin-top: 10px; margin-right: auto; margin-left: auto; padding: 0px;\"><span class=\"md-plain\" style=\"margin: 0px; padding: 0px;\">表达式值为非0字符</span></p></li><li class=\"md-list-item\" style=\"margin: 0px 0px 1em; padding: 0px; list-style: disc;\"><p class=\"md-end-block md-p\" style=\"margin-top: 10px; margin-right: auto; margin-left: auto; padding: 0px;\"><span class=\"md-plain\" style=\"margin: 0px; padding: 0px;\">表达式值为字符串，但不是<span style=\"margin: 0px; padding: 0px;\"><code style=\"margin: 0px; padding: 0px;\">\"false\"</code><span class=\"md-plain\" style=\"margin: 0px; padding: 0px;\">,<span style=\"margin: 0px; padding: 0px;\"><code style=\"margin: 0px; padding: 0px;\">\"no\"</code><span class=\"md-plain\" style=\"margin: 0px; padding: 0px;\">,<span style=\"margin: 0px; padding: 0px;\"><code style=\"margin: 0px; padding: 0px;\">\"off\"</code></span></span></span></span></span></span></p></li><li class=\"md-list-item\" style=\"margin: 0px 0px 1em; padding: 0px; list-style: disc;\"><p class=\"md-end-block md-p\" style=\"margin-top: 10px; margin-right: auto; margin-left: auto; padding: 0px;\"><span class=\"md-plain\" style=\"margin: 0px; padding: 0px;\">表达式不是布尔、字符串、数字、字符中的任何一种</span></p></li></ul>', null, '0', '2020-03-18 16:42:33', '1', '02');
